<html>

<head>
    <title>
        Program to Print the given array using "for of" loop
    </title>
</head>

<body>
    <h1>Print the given array using "for of" loop</h1>
</body>
<script>
    var ip = [33, 44, 11, 33, 44, 555, 11, 11, 45];
    document.write("Array elements are:")
    for (var input of ip) {
        document.write("<br/>", input);
    }
</script>

</html>
